import React from 'react'
import { Bar} from 'react-chartjs-2'

const BarChart = () => {
    return (
        <div>
            <Bar
            // Two curly, first is dynamic javascript content, second is actual javascript object
                data={{
                    labels: ['Red', 'Blue', 'Yellow', 'Green', 'Purple', 'Orange'],
                }}
                height={400}
                width={600}
            />
        </div> 
    )
}

export default BarChart
